		"text": "거리두기 2.5단계 조치가 1월 17일까지 연장됨에 따라 이 공연은 뮤지션과의 협의를 거쳐 취소하기로 결정했습니다. 예매자분들께는 네이버 예약 시스템을 통한 개별 연락과 환불이 진행되었습니다. 아쉽지만 모두 건강히 이 힘겨운 시절을 이겨낼 수 있기를 빌겠습니다. 감사합니다."
